import React from "react";
import styled from "styled-components";
function Register() {
  const hadnleSubmit = (e) => {
    e.preventDefault();
    alert("form");
  };
  return (
    <>
      <FormContainer>
        <form onSubmit={(e) => hadnleSubmit(e)}>
          <div className="brand">
            <img src="" alt=""></img>
            <h1>snappy</h1>
          </div>
        </form>
      </FormContainer>
    </>
  );
}

const FormContainer = styled.div``;

export default Register;
